#include<bits/stdc++.h>
using namespace std;

int gcd(int a, int b)
{
  if (a == 0)
    return b;
  return gcd(b % a, a);
}

vector<int> getN(){
    vector<int> possible;
    possible.push_back(3);
    int i=2, cnt=3;
    while(cnt<=1e6){
        cnt = (++i) + cnt;
        possible.push_back(cnt);
    }
    return possible;
}

vector<int> getComb(){
    vector<int> pos = getN();
    vector<int> comb (1e6+5, 0);

    for(int i : pos) comb[i]=1;
    
    for(int i=0; i<1e6+5; i++){
        if(comb[i]){
            int j=0;
            while(j<pos.size() && i+pos[j]<1e6+5){
                comb[i+pos[j++]]=1;
            }
        }
    }

    return comb;
}



int gen(){

    vector<int> comb = getComb();

    ofstream MyFile("comb.txt");

    
    for(int i=0; i<comb.size(); i++){
        MyFile << comb[i];
    }
    
    

    MyFile.close();
    

}

